import { useSelector } from "react-redux";
import { PortfolioItem } from "./PortfolioItem";

export const Portfolio = () => {
  // Make sure you're selecting the right slice of the state
  const { myStock } = useSelector((state) => state.stock);  // Updated here
  console.log(myStock);

  return (
    <div className="flex-column gap-1">
      <h2>Portfolio</h2>

      {/* Mapping through myStock and rendering PortfolioItem components */}
      <ul className="flex-column gap-1">
        {myStock.map((item) => (
          <PortfolioItem key={item.id} stock={{ ...item }} />
        ))}
      </ul>
    </div>
  );
};
